import './App.css';
import React from 'react';
import ReactDOM from 'react-dom/client';
import {ListHouses} from './components/ListHouses.js';
import Header from './components/Header.js';
import { BtnAddHouse } from './components/AddHouse.js';
import { Button } from '@mui/material';

function App() {
  // const root = ReactDOM.createRoot(document.getElementById('root'));
  // root.render(<><Header /><ListHouses  /><BtnAddHouse/></>);

  const [components, setComponents] = useState(["House Test"]);

  function addComponent(){
    setComponents([...components, "House Test"])
  }

  return (

    <div>
      <Header></Header>
      <BtnAddHouse onClick={addComponent} text="Add House"/>
      {components.map((item, i) => (<ListHouses text={item} />))}
    </div>
  )

}

export default App;
